  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Audubon
  Wetland Management District outlines Refuge accomplishments during the 1980 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  research and investigations. Habitat management is also covered; subjects include
  wetlands, forests, croplands, grasslands, grazing, pest control, and WPA easements.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, game mammals, and fisheries resources. The
  public uses of the Refuge described in this report include hunting and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction. Cooperative programs and items of interest are provided at the end.\",\n\t\"license_title\":
